/*Table structure for table `myweb_users` */

DROP TABLE IF EXISTS `myweb_users`;

CREATE TABLE `myweb_users` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '用户id',
  `username` varchar(32) COLLATE utf8_german2_ci NOT NULL COMMENT '账号',
  `name` varchar(16) COLLATE utf8_german2_ci DEFAULT NULL COMMENT '真实姓名',
  `passwd` char(32) COLLATE utf8_german2_ci NOT NULL COMMENT '密码',
  `sex` tinyint(1) DEFAULT NULL COMMENT '性别',
  `address` varchar(255) COLLATE utf8_german2_ci DEFAULT NULL COMMENT '地址',
  `code` char(6) COLLATE utf8_german2_ci DEFAULT NULL COMMENT '邮编',
  `phone` varchar(16) COLLATE utf8_german2_ci DEFAULT NULL COMMENT '电话',
  `email` varchar(50) COLLATE utf8_german2_ci NOT NULL COMMENT 'Email',
  `state` tinyint(1) DEFAULT '1' COMMENT '状态:1：启用，2：禁用 0:后台管理员',
  `addtime` varchar(50) COLLATE utf8_german2_ci DEFAULT NULL COMMENT '注册时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`username`)
) ENGINE=InnoDB AUTO_INCREMENT=69 DEFAULT CHARSET=utf8 COLLATE=utf8_german2_ci;

